    "2013-03-14T19:33:22.991183",nt"name": "giant-reed-distribution-northern-california-ds333",nt"isopen":
    false,nt"url": null,nt"notes": "The Arundo Distribution layer is a compilation
    of Arundo donax observations in northern and central California, obtained from several
    sources, including Arundo infestations mapped by Sonoma Ecology Center in areas
    where Arundo occurrence data were missing or incomplete. The primary focus of the
    data collection was on the San Francisco Bay Estuary and Delta CALFED regions, i.e.,
    waters that ultimately drain into the San Francisco Bay. Data were also accepted
    from the Sacramento-San Joaquin Valley Region. This GIS layer is an indicator of
    the spatial and temporal distribution of Arundo occurrences represented by the contributed
    data. It is a data aggregation that serves as an index to the contributors' original
    data. The contributor should be consulted for further questions about the data.
    By using the link in the "Metadata" field for any specific Arundo occurrence record,
    the user can access a metadata record (stored at CERES, California Environmental
    Resources Evaluation system) with full contact information for the data contributor.",nt"license_title":
